import "../style/App.scss";

function Pokemon(props) {
  return (
    <li key={props.pokemon.id}>
      <img src={props.pokemon.url} alt={props.pokemon.name} />
      <h2>{pokemon.name}</h2>
      <p>
        {pokemon.types[0]} {pokemon.types[1]}
      </p>
    </li>
  );
}
export default Pokemon;
